function prediction_tool(points, crr=0.0025, mass_total=79, delta_CDA=0, FTP=430){

  function degrees(x) { return x * 180 / Math.PI; }
  function radians(x) { return x * Math.PI / 180; }

  function bearing_rad(a, b, c, d){
    // a = prev_latitude_rad
    // b = prev_longitude_rad
    // c = cur_latitude_rad
    // d = cur_longitude_rad
    // Note that Math.atan2 takes parameter in reverse order than excel atan2

    return Math.atan2(Math.sin(d-b)*Math.cos(c) , (Math.cos(a)*Math.sin(c))-(Math.sin(a)*Math.cos(a)*Math.cos(d-b)))  % (2*Math.PI);
  }

  function calculate_relative_wind_speed(speed, wind_speed_1m, relative_wind_angle){
    return Math.sqrt(((speed+wind_speed_1m*Math.cos(radians(relative_wind_angle)))**2)+(wind_speed_1m*Math.sin(radians(relative_wind_angle)))**2);
  }

  function calculate_effective_yaw_angle(speed, wind_speed_1m, relative_wind_angle){
    return degrees(Math.atan(wind_speed_1m*Math.sin(radians(relative_wind_angle))/(speed+wind_speed_1m*Math.cos(radians(relative_wind_angle)))));
  }

  function average(array){
    var ret = 0;
    for(let i=0; i<array.length; i++) ret += array[i];
    return ret/array.length;
  }

  function get_position(climb_threshold_slope, descending_threshold_slope, slope_percent){
    if(slope_percent > climb_threshold_slope){
      return "b";
    }else if(slope_percent < climb_threshold_slope && slope_percent > descending_threshold_slope){
      return "a";
    }else if(slope_percent < descending_threshold_slope){
      return "c";
    }
    return "error";
  }


  function get_min_slope(course_info){
    var ret = course_info[0]["slope_percent"];
    for(let i=1; i<course_info.length; i++){
      if(course_info[i]["slope_percent"] < ret){
        ret = course_info[i]["slope_percent"];
      }
    }
    return ret;
  }

  function get_max_slope(course_info){
    var ret = course_info[0]["slope_percent"];
    for(let i=1; i<course_info.length; i++){
      if(course_info[i]["slope_percent"] > ret){
        ret = course_info[i]["slope_percent"];
      }
    }
    return ret;
  }

  function get_power_in(slope, min_descending, max_descending, min_steady_state, max_steady_state, min_over_threshold, max_over_threshold, FTP){
    // console.log(min_descending);
    // console.log(max_descending);
    // console.log(min_steady_state);
    // console.log(max_steady_state);
    // console.log(min_over_threshold);
    // console.log(max_over_threshold);
    if(slope >= min_descending && slope <= max_descending ){
      return (decsending_ave/100) * FTP;
    }else if(slope >= min_steady_state && slope <= max_steady_state){
      return (steady_state_FTP/100) * FTP;
    }else if(slope >= min_over_threshold && slope <= max_over_threshold){
      return (over_threshold_FTP/100) * FTP;
    }
  }

  // Calculate and store course info

  // var course_info_wai=[];

  // var course_input = {course_id: 2};
  // axios.post('course_info/track_info_Sim',course_input).then(res =>{
  //   // course_info_wai = res.data
  //   for(let i=0; i<res.data.length; i++){
  //     course_info_wai.push([res.data[i].lat,res.data[i].lon,res.data[i].ele,res.data[i].dist,res.data[i].bearing]);
  //   }
  // });

  // console.log(course_info_wai);

  const course_info = [];

  for(let i=0; i<points.length; i++){

    var bearing_radians = i == 0 ? 0 : bearing_rad(radians(points[i-1][0]), radians(points[i-1][1]), radians(points[i][0]), radians(points[i][1]));

    var slope = i == 0? 0 : (points[i][2]-points[i-1][2]) / (points[i][3] - points[i-1][3]);

    course_info.push(
      {
        "latitude_deg":points[i][0],
        "latitude_rad":radians(points[i][0]),
        "longitude_deg":points[i][1],
        "longitude_rad":radians(points[i][1]),
        "elevation":points[i][2],
        "distance": points[i][3],
        "bearing_rad": bearing_radians,
        "bearing_deg": degrees(bearing_radians),
        "slope": slope,
        "slope_percent":0,
        "segment": 1,
        "roughness": 1,
        "wind_speed_1m": 1,
      }
    );
  }

  // User input
  const user_defined_w_prime = 35000; //Joule
  const w_prime_recovery = 1;


  const headwind_direction = -150; //given as constant in excel
  const dt = 0.5; //seconds
  const climb_threshold_slope = 3; //percent
  const descending_threshold_slope = -1; //percent

  // const crr = 0.0025;
  const mech_eff = 0.98; //percent
  const mol_whl_front = 0.08;
  const mol_whl_rear = 0.08;
  const wheel_radius = 0.335;

  const delta_watts = -20;
  // const delta_CDA = 0;
  const delta_kg = 0;

  // const FTP = 430; // (or CP) in Watt (W)
  const w_prime = 35000; //Joule (J)

  // input that affects power
  const steady_state_FTP = 91; // percent % of FTP at steady state
  const over_threshold_FTP = 110; // percent % of FTP when over threshold
  const decsending_ave = 2; //percent % of FTP when descending

  // adjusted FTP / CP input
  const adjusted_steady_state_FTP = (steady_state_FTP/100) * FTP;
  const adjusted_over_threshold_FTP = (over_threshold_FTP/100) * FTP;
  const adjusted_decreasing_ave_FTP = (decsending_ave/100) * FTP;

  //power vs slope info input
  const slope_threshold_steady = -1;
  const slope_threshold_over = 7.5;

  // CDA
  const climbing_position_CDA_increment = 0.04;
  const decsending_position_CDA_increment = -0.005;
  const seated_zero_pos_CDA = [0.188, 0.188, 0.188, 0.186, 0.184, 0.183, 0.182, 0.182, 0.182, 0.182, 0.182, 0.182];

  const density = 1.13;	// kg/m^3

  const mass_rider = 71;
  const mass_bike = 7;
  const mass_other = 1;
  // const mass_total = mass_rider + mass_bike + mass_other;

  // go through course info again to fill in slope percentage

  for(let i=1; i<points.length-1; i++){
    course_info[i]["slope_percent"] = average([course_info[i-1]["slope"], course_info[i]["slope"], course_info[i+1]["slope"]])*100;
  }

  // go through course info again to fill in position

  for(let i=0; i<points.length; i++){
    if(i==0) {course_info[i]["position"] = "b"; continue;}
    course_info[i]["position"] = get_position(climb_threshold_slope, descending_threshold_slope, course_info[i]["slope_percent"]);
  }

  // power vs terrain
  const min_descending = get_min_slope(course_info) - 5;
  const max_descending = slope_threshold_steady - 0.00001;

  const min_steady_state = slope_threshold_steady;
  const max_steady_state = slope_threshold_over;

  const min_over_threshold = slope_threshold_over + 0.00001;
  const max_over_threshold = get_max_slope(course_info) + 5;

  // Time and distance initialisation

  function lookup_approximate(lookup_value, array, compare_col, ret_col){
    var prev = array[0][compare_col];
    var cur = array[1][compare_col];
    for(let i=1; i<array.length; i++){
      cur = array[i][compare_col];
      if(lookup_value >= prev && lookup_value <= cur){
        return array[i-1][ret_col];
      }
      prev = array[i][compare_col];
    }

    return 0;
  }

  function get_exact_CDA(position, wind_scale){
    if(position == "a"){
      return seated_zero_pos_CDA[wind_scale-2];
    }else if(position == "b"){
      return seated_zero_pos_CDA[wind_scale-2] + climbing_position_CDA_increment;
    }else if(position == "c"){
      return seated_zero_pos_CDA[wind_scale-2] - decsending_position_CDA_increment;
    }
  }

  function get_tprime(w_prime_recovery, user_defined_w_prime, DCp){
    if(w_prime_recovery == 1){
      return 2287.2 * DCp ** -0.688;
    }else if(w_prime_recovery == 2){
      return user_defined_w_prime / DCp;
    }else if(w_prime_recovery == 3){
      return 546 * Math.exp( -0.01 * DCp ) + 316;
    }
    return 0;

  }

  function get_wprime(prev_wprime, OTenergy, user_defined_w_prime, dt, tprime){
    if(DCp == 0){
      return prev_wprime - OTenergy;
    }else{
      return user_defined_w_prime - ( user_defined_w_prime - prev_wprime ) * Math.exp(-dt/tprime)
    }
  }

  const calculation = [];


  // First step calculation
  var distance = 0.1;
  var speed = 0.3; //initial speed
  var kph = speed * 3.6; //km/h
  var slope = lookup_approximate(distance, course_info, "distance", "slope"); //percentage in excel
  var bearing_deg = lookup_approximate(distance, course_info, "distance", "bearing_deg");
  var relative_wind_angle = bearing_deg - headwind_direction;
  // var wind_speed_1m = lookup_approximate(distance, course_info, "distance", "wind_speed_1m");
  var wind_speed_1m = 1.0;
  var relative_wind_speed = calculate_relative_wind_speed(speed, wind_speed_1m, relative_wind_angle);
  var effective_yaw_angle = calculate_effective_yaw_angle(speed, wind_speed_1m, relative_wind_angle);
  var position = lookup_approximate(distance, course_info, "distance", "position");
  var power_in = mech_eff * get_power_in(Math.round(slope*100), min_descending, max_descending, min_steady_state, max_steady_state, min_over_threshold, max_over_threshold, FTP) + delta_watts;
  var CDA = delta_CDA + get_exact_CDA(position, lookup_approximate(relative_wind_speed, wind_scale, 0, 1)) + lookup_approximate(Math.abs(effective_yaw_angle), yaws, 0, 2);
  var power_aero = 0.5 * density * relative_wind_speed**3 * CDA;
  var power_roll = mass_total * crr * 9.81 * speed;
  var power_gravity = slope * 9.81 * mass_total * speed;
  var power_net = power_in - power_aero - power_roll - power_gravity;
  var propulsive_force = power_net / speed;
  var acceleration = propulsive_force / (mass_total+(mol_whl_front/wheel_radius**2)+(mol_whl_rear/wheel_radius**2));
  var segment = lookup_approximate(distance, course_info, "distance", "segment");
  var DCp = (-(power_in*(1/mech_eff)-FTP)<0) ? 0 : (-(power_in*(1/mech_eff)-FTP));
  var OTenergy = ((power_in*(1/mech_eff))-FTP > 0) ? (power_in*(1/mech_eff))*dt : 0;
  var tprime = get_tprime(w_prime_recovery, user_defined_w_prime, DCp);
  var wprime = get_wprime(user_defined_w_prime, OTenergy, user_defined_w_prime, dt, tprime);

  // push to first calculation to an array
  calculation.push(
    {
      time: 0,
      distance: distance,
      speed: speed,
      kph: kph, // km/h
      slope: Math.round(slope*100),
      bearing_deg: bearing_deg,
      relative_wind_angle: relative_wind_angle,
      wind_speed_1m: wind_speed_1m,
      relative_wind_speed: relative_wind_speed,
      effective_yaw_angle: effective_yaw_angle,
      position: position,
      power_in: power_in,
      CDA: CDA,
      power_aero: power_aero,
      power_roll: power_roll,
      power_gravity: power_gravity,
      power_net: power_net,
      propulsive_force: propulsive_force,
      acceleration, acceleration,
      segment: segment,
      DCp: DCp,
      OTenergy: OTenergy,
      tprime: tprime,
      wprime: wprime,
    }
  )

  // computing details for every dt time unit
  var max_distance = course_info[course_info.length-1]["distance"];
  var current_distance = 0.1;
  var i = 1;


  while(current_distance <= max_distance){

    var time = calculation[i-1]["time"] + dt;
    var speed = calculation[i-1]["speed"] + ((calculation[i-1]["acceleration"]) * dt); //initial speed
    var distance = calculation[i-1]["distance"] + (speed * dt);
    var kph = speed * 3.6; //km/h
    var slope = lookup_approximate(distance, course_info, "distance", "slope");
    var bearing_deg = lookup_approximate(distance, course_info, "distance", "bearing_deg");
    var relative_wind_angle = bearing_deg - headwind_direction;
    // var wind_speed_1m = lookup_approximate(distance, course_info, "distance", "wind_speed_1m");
    var wind_speed_1m = 1.0;
    var relative_wind_speed = calculate_relative_wind_speed(speed, wind_speed_1m, relative_wind_angle);
    var effective_yaw_angle = calculate_effective_yaw_angle(speed, wind_speed_1m, relative_wind_angle);
    var position = lookup_approximate(distance, course_info, "distance", "position");
    var power_in = mech_eff * get_power_in(Math.round(slope*100), min_descending, max_descending, min_steady_state, max_steady_state, min_over_threshold, max_over_threshold, FTP) + delta_watts;
    var CDA = delta_CDA + get_exact_CDA(position, lookup_approximate(relative_wind_speed, wind_scale, 0, 1)) + lookup_approximate(Math.abs(effective_yaw_angle), yaws, 0, 2);
    var power_aero = 0.5 * density * relative_wind_speed**3 * CDA;
    var power_roll = mass_total * crr * 9.81 * speed;
    var power_gravity = slope * 9.81 * mass_total * speed;
    var power_net = power_in - power_aero - power_roll - power_gravity;
    var propulsive_force = power_net / speed;
    var acceleration = propulsive_force / (mass_total+(mol_whl_front/wheel_radius**2)+(mol_whl_rear/wheel_radius**2));
    var segment = lookup_approximate(distance, course_info, "distance", "segment");
    var DCp = (-(power_in*(1/mech_eff)-FTP)<0) ? 0 : (-(power_in*(1/mech_eff)-FTP));
    var OTenergy = ((power_in*(1/mech_eff))-FTP > 0) ? (power_in*(1/mech_eff))*dt : 0;
    var tprime = get_tprime(w_prime_recovery, user_defined_w_prime, DCp);
    var wprime = get_wprime(calculation[i-1]["wprime"], OTenergy, user_defined_w_prime, dt, tprime);

    calculation.push(
      {
        time: time,
        distance: distance,
        speed: speed,
        kph: kph, // km/h
        slope: Math.round(slope*100),
        bearing_deg: bearing_deg,
        relative_wind_angle: relative_wind_angle,
        wind_speed_1m: wind_speed_1m,
        relative_wind_speed: relative_wind_speed,
        effective_yaw_angle: effective_yaw_angle,
        position: position,
        power_in: power_in,
        CDA: CDA,
        power_aero: power_aero,
        power_roll: power_roll,
        power_gravity: power_gravity,
        power_net: power_net,
        propulsive_force: propulsive_force,
        acceleration, acceleration,
        segment: segment,
        DCp: DCp,
        OTenergy: OTenergy,
        tprime: tprime,
        wprime: wprime,
      }
    )

    i+=1;
    current_distance = distance;
  }


  return calculation;
}



